import React from "react";

export default function Chatting() {
  return (
    <div>
      <div className="friend-header">
        <div className="friend-header-search">
          <input
            type="text"
            className="friend-search-label"
            placeholder="Tìm kiếm bạn bè"
          />
          <i className="fas fa-search"></i>
        </div>
      </div>
    </div>
  );
}
